[{"operationName":"getSearchCategories","variables":{"selectedId":327,"locale":"en-CA"},"query":"query getSearchCategories($locale: String!, $selectedId: Int) {
  searchCategories(selectedId: $selectedId) {
    id
    localizedName(locale: $locale)
    l1Category {
      id
      __typename
    }
    __typename
  }
}
"},{"operationName":"getCategoryPaths","variables":{"id":327},"query":"query getCategoryPaths($id: Int!) {
  category(id: $id) {
    categoryPaths {
      id
      __typename
    }
    __typename
  }
}
"},{"operationName":"GetSurvey","variables":{"surveyId":1},"query":"query GetSurvey($surveyId: Int!) {
  survey(surveyId: $surveyId) {
    title
    questions {
      id
      text
      answers {
        id
        text
        type
        __typename
      }
      __typename
    }
    __typename
  }
}
"},{"operationName":"GetAlgoliaKey","variables":{},"query":"mutation GetAlgoliaKey {
  getAlgoliaKey
}
"}]
